          <h1>Name: {pro.title}</h1>
          <h3>Category: {pro.category}</h3>
          <h3>Rating: {pro.rating}</h3>
          <button onClick={() => handleAddToCart(pro)}>Add To Cart</button>
        </StyledProductCard>
      ))} */}
    </div>
  );
}
